import './styles.scss';
import Buttons from './../Forms/Button';
import { signInWithGoogle } from './../../Firebase/utils';


const SignIn = props => {
    return(
        <div className = "signin">
            <div className = 'wrap'>
                <h2>
                    LogIn
                </h2>


                <div className = 'formWrap'>
                    <form>
                        <div className = 'socialSignin'>
                            <div className = 'row'>
                                <Buttons>
                                    Sign in with Google
                                </Buttons>
                            </div>
                        </div>
                    </form>
                </div>
            </div>
        </div>
    );
}

export default SignIn;
